import Layout from '../components/Layout'
import Form from '../components/Form'

const Index = () => (
    <Layout>
        <div>
            <Form/>
        </div>
    </Layout>
);

handleSubmit = (character) => {
    this.setState({characters: [...this.state.characters, character]})
  }
export default Index;
